import React, { useState } from "react";
import Slider from "@mui/material/Slider";
import Box from "@mui/material/Box";
import Typography from '@mui/material/Typography';



const ForgeMain = () => {
  const [priceRange, setPriceRange] = useState([10, 100]);

  // Handle slider change
  const handleChange = (event, newValue) => {
    setPriceRange(newValue);
  };
  const [value] = useState(50);

  return (

<div className="container mt-3 main_forge">
    <div className="row m-0">
        <div className="col-md-4 border2">
        <div class="input-icon-wrap">
      <h4>price</h4>
  <span class="input-icon">
    <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24"><g fill="none" stroke="#fff" stroke-linecap="round" stroke-linejoin="round" stroke-width="1.5"><path d="M12 21.5a9.5 9.5 0 1 0 0-19a9.5 9.5 0 0 0 0 19"/><path d="M9 14.433a2.82 2.82 0 0 0 3 2.57c2.42 0 3-1.39 3-2.57s-1-2.43-3-2.43s-3-.79-3-2.4a2.75 2.75 0 0 1 3-2.6a2.89 2.89 0 0 1 3 2.6M12 18.5v-1.3m0-11.7v1.499"/></g></svg>
    </span>
  <input type="text" class="input-with-icon" id="form-name"></input>
</div>  
    <Box sx={{ width: 300, margin: "0 auto", padding: "20px" }}>
      <Slider
        value={priceRange}
        onChange={handleChange}
        valueLabelDisplay="auto"
        min={0}
        max={500}
        step={10}
      />
      <p>
        Selected Range: ${priceRange[0]} - ${priceRange[1]}
      </p>
      <Typography>Selected Value: ${value}</Typography>
    </Box>   
    </div>

<div className="col-md-4">

</div>

<div className="col-md-4 border2 svg_desig">
<svg viewBox="0 0 45 45" focusable="false" class="chakra-icon css-1eybg3y" data-sentry-element="Brand" data-sentry-source-file="SelectedProduct.tsx"><path d="M3.21192 7.42225C1.15968 8.23994 0.158879 10.5665 0.976565 12.6187L12.821 42.346C13.6387 44.3982 15.9652 45.399 18.0174 44.5813L34.739 37.9188C36.7913 37.1012 37.7921 34.7746 36.9744 32.7224L25.13 2.99512C24.3123 0.942884 21.9857 -0.0579184 19.9335 0.759768L3.21192 7.42225Z" fill="currentColor"></path><path d="M35.8047 22.5693L35.7383 6.50156C35.7292 4.29244 33.931 2.50898 31.7219 2.5181L27.822 2.5342L35.8047 22.5693Z" fill="currentColor"></path><path d="M38.0241 27.9748L44.3787 13.2168C45.2524 11.1878 44.3158 8.83469 42.2868 7.96101L38.7048 6.41865L38.0241 27.9748Z" fill="currentColor"></path></svg>
<p>Select a product below to get started</p>
<ul>
  <li><p>$0.00</p></li>
  <li><p>$0.00</p></li>
</ul>

</div>


    </div>
    </div>
  );
};

export default ForgeMain;
